import React from 'react';
import { useState, useEffect } from 'react';
import { useNavigate, Link } from "react-router-dom";

function Chat({ loggedIn }) {
  
  const navigate = useNavigate();

  useEffect(() => {
    if (!loggedIn) {
      navigate('/login');
    }
  }, [])
  return (

    <div>Chat</div>
  )
}

export default Chat
